import HomeFourthSection from './components/HomeFourthSection';

function App() {
  return (
    <div className='page'>
    <HomeFirstSection />
    <HomeSecondSection />
    <HomeBookingSection/>
    < HomeFourthSection />
    </div>
  );
}

export default App;
